import React,{Component} from 'react';
import axios from 'axios';

class Home extends Component{

    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/posts')
            .then(res =>{
                console.log(res)
            })
    }
    render(){
        return(
            <div className="container">
                <h4 className="center">Home Page</h4>
                <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Accusamus aperiam dolores ex nobis, numquam sapiente soluta tempora! Animi, aperiam dignissimos est, incidunt molestiae necessitatibus officiis optio quisquam reiciendis sed voluptates?</p>
            </div>
        )
    }
}

export default Home;
